import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

const App = () => (
  <>
  <>Games</>
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<h1>Home</h1>} />
      <Route path="expenses" element={<h1>Expenses</h1>} />
      <Route path="invoices" element={<h1>Invoices</h1>} />
    </Routes>
  </BrowserRouter>,
  </>
)

export default App;
